import React from "react";
import "./Profile.css";
import Button from '@mui/material/Button';

export default function Profile() {
  return (
    <div>
      <div className="profile-container">
        <div className="profile-conz">
            <Button variant="contained">Submit</Button>
        </div>
      </div>
    </div>
  );
}
